import React, { Component } from 'react';
import Unsplash from 'react-unsplash-wrapper';
import {withProvider} from '../GlobalProvider.js';

class UnsplashOne extends Component {
    constructor(props){
        super(props)
        this.state = {
            search:''
        }

    }

    componentDidMount(){
        this.setState({search:this.props.searchword});
    }

    render() { 
        return ( 
            <div style={{position: 'relative', width: 500, height: 400, margin: 'auto'}}>
                <Unsplash keywords={this.state.searchword} expand />
            </div>
        );
    }
}
export default withProvider(UnsplashOne);
